Secret chats are accepted or refused automatically, based on a value in the settings (by default MadelineProto is set to accept all secret chats).
Before sending any message, you must check if the secret chat was accepted by the other client with the following method:
$status is 0 if the chat cannot be found in the local database, 1 if the chat was requested but not yet accepted, and 2 if it is a requested but not yet accepted chat.
The following example shows how to send a message to a client (not connected to MadelineProto):
$clientid = 'whatever you want';
$message = 'Hello world';
$timestamp = time();
$status = MadelineProto::sendMessage($clientid, $message, $timestamp);
print_r($status); // prints 1
The function MadelineProto::sendMessage() requires a MadelineProto object, a message to send, and the client identifier you want to send to.
